import {FETCH_INSTRUCTOR_REQUEST, FETCH_INSTRUCTOR_SUCCESS, FETCH_INSTRUCTOR_FAILURE} from './instructorTypes';

const initialState = {
    instructors: [],
    error: ''
};

const reducer = (state = initialState, action) => {
    switch(action.type) {
        case FETCH_INSTRUCTOR_REQUEST:
            return {
                ...state
            };
        case FETCH_INSTRUCTOR_SUCCESS:
            return {
                instructors: action.payload,
                error: ''
            };
        case FETCH_INSTRUCTOR_FAILURE:
            return {
                instructors: [],
                error: action.payload
            };
        default:
            return state;
    }
};

export default reducer;
